import { Link } from "react-router-dom";
import "./BreedCard.modules.css"

const BreedCard = ({id, name, img, temperament, weight, lifeSpan}) => {

    let temperamentText = temperament;
    const temperamentArray = temperament.split(',');
    if (temperamentArray.length > 7) {
        const firstSevenTemperaments = temperamentArray.slice(0, 7).join(', ');
        temperamentText = `${firstSevenTemperaments + " and " + temperamentArray.length } others`;
    }

    return (
        <Link to = {`/detail/${id}`}>
            <div className = "container">
                <h2 className="titleBreed"> {name}</h2>
                <img src = {img} alt = {name} className = "breedPicture"/>
                <div className="data">
                    <p> {temperamentText}</p>
                    <p> Average life span: {lifeSpan}</p>
                    <p> {weight.metric} kg</p>
                </div>
            </div>
        </Link>
        
    )
}

export default BreedCard;
